import React, { useEffect } from 'react';
import {Link} from "react-router-dom"
import { useDispatch } from 'react-redux';

function Provider2 ({info}) {
    const dispatch = useDispatch()
    const [domesticViolence, setDomesticViolence] = React.useState(false);
    const [LGBTQ, setLGBTQ] = React.useState(false);
    const [crisisResources, setCrisisResources] = React.useState(false);
    const [humanTrafficking, setHumanTrafficking] = React.useState(false);
    const [military, setMilitary] = React.useState(false);
    const [lawEnforcement, setLawEnforcement] = React.useState(false);
    const [elderSurvivor, setElderSurvivor] = React.useState(false);
    const [childSurvivor, setChildSurvivor] = React.useState(false);
    const [allResources, setAllResources] = React.useState(false);
    const [legalAdvice, setLegalAdvice] = React.useState(false);
    const [forensicExams, setForensicExams] = React.useState(false);
    const [generalHealth, setGeneralHealth] = React.useState(false);
    const [pregnancy, setPregnancy] = React.useState(false);
    const [housing, setHousing] = React.useState(false);
    const [collegeOnCampus, setCollegeOnCampus] = React.useState(false);
    const [title9, setTitle9] = React.useState(false);
    const [tribal, setTribal] = React.useState(false);
    const [coalition, setCoalition] = React.useState(false);
    const [std, setStd] = React.useState(false);
    const [hivSupport, setHivSupport] = React.useState(false);
    const [blindDeaf, setBlindDeaf] = React.useState(false);
    const [disabled, setDisabled] = React.useState(false);
    const [specialNeeds, setSpecialNeeds] = React.useState(false);
    const [immigrants, setImmigrants] = React.useState(false);
    info.LGBTQ = LGBTQ
    info.blindDeaf = blindDeaf
    info.disabled = disabled
    info.military = military
    info.childSurvivor = childSurvivor
    info.elderSurvivor = elderSurvivor
    info.specialNeeds = specialNeeds
    info.immigrants = immigrants
    info.domesticViolence = domesticViolence
    info.crisisResources = crisisResources
    info.humanTrafficking = humanTrafficking


    function updateSpecialNeeds() {
        document.getElementById('specialNeeds').style.backgroundColor = "rgb(166,220,220)";
        setSpecialNeeds(true);
      }
      function updateImmigrants() {
        document.getElementById('immigrants').style.backgroundColor = "rgb(166,220,220)";
        setImmigrants(true);
      }
    function updateDomesticViolence() {
        document.getElementById('domesticViolence').style.backgroundColor = "rgb(166,220,220)";
        setDomesticViolence(true);
      }
      function updateBlindDeaf() {
        document.getElementById('blindDeaf').style.backgroundColor = "rgb(166,220,220)";
        setBlindDeaf(true);
      }
      function updateLGBTQ() {
        document.getElementById('LGBTQ').style.backgroundColor = "rgb(166,220,220)";
        setLGBTQ(true);
      }
      function updateDisabled() {
        document.getElementById('disabled').style.backgroundColor = "rgb(166,220,220)";
        setDisabled(true);
      }

      function updateCrisisResources() {
        document.getElementById('crisisResources').style.backgroundColor = "rgb(166,220,220)";
        setCrisisResources(true);
      }

      function updateHumanTrafficking() {
        document.getElementById('humanTrafficking').style.backgroundColor = "rgb(166,220,220)";
        setHumanTrafficking(true);
      }

      function updateMilitary() {
        document.getElementById('military').style.backgroundColor = "rgb(166,220,220)";
        setMilitary(true);
      }

      function updateLawEnforcement() {
        document.getElementById('lawEnforcement').style.backgroundColor = "rgb(166,220,220)";
        setLawEnforcement(true);
      }

      function updateElderSurvivor() {
        document.getElementById('elderSurvivor').style.backgroundColor = "rgb(166,220,220)";
        setElderSurvivor(true);
      }

      function updateChildSurvivor() {
        document.getElementById('childSurvivor').style.backgroundColor = "rgb(166,220,220)";
        setChildSurvivor(true);
      }

      function updateAllResources() {
        document.getElementById('allResources').style.backgroundColor = "rgb(166,220,220)";
        setAllResources(true);
      }

      function updateLegalAdvice() {
        document.getElementById('legalAdvice').style.backgroundColor = "rgb(166,220,220)";
        setLegalAdvice(true);
      }

      function updateForensicExams() {
        document.getElementById('forensicExams').style.backgroundColor = "rgb(166,220,220)";
        setForensicExams(true);
      }

      function updateGeneralHealth() {
        document.getElementById('generalHealth').style.backgroundColor = "rgb(166,220,220)";
        setGeneralHealth(true);
      }

      function updatePregnancy() {
        document.getElementById('pregnancy').style.backgroundColor = "rgb(166,220,220)";
        setPregnancy(true);
      }

      function updateHousing() {
        document.getElementById('housing').style.backgroundColor = "rgb(166,220,220)";
        setHousing(true);
      }

      function updateCollegeOnCampus() {
        document.getElementById('collegeOnCampus').style.backgroundColor = "rgb(166,220,220)";
        setCollegeOnCampus(true);
      }

      function updateTitle9() {
        document.getElementById('title9').style.backgroundColor = "rgb(166,220,220)";
        setTitle9(true);
      }

      function updateTribal() {
        document.getElementById('tribal').style.backgroundColor = "rgb(166,220,220)";
        setTribal(true);
      }

      function updateCoalition() {
        document.getElementById('coalition').style.backgroundColor = "rgb(166,220,220)";
        setCoalition(true);
      }

      function updateStd() {
        document.getElementById('std').style.backgroundColor = "rgb(166,220,220)";
        setStd(true);
      }

      function updateHivSupport() {
        document.getElementById('hivSupport').style.backgroundColor = "rgb(166,220,220)";
        setHivSupport(true);
      }


    return (
       <div className="text-lg ">
            <h1 className="text-5xl justify-center font-serif  flex mt-5">Second Step</h1>
        <div className="flex justify-center mt-5">

            <button className=" bg-teal-600 border-2 border-teal-700 shadow-md shadow-slate-400 font-serif rounded-xl p-1 h-20 w-36" id="LGBTQ" onClick={updateLGBTQ}>LGBTQ</button>
            <button className="bg-teal-600 shadow-md border-2 border-teal-700 shadow-slate-400 mr-1 h-20 font-serif rounded-xl p-1 w-36" id="blindDeaf" onClick={updateBlindDeaf}>Blind/Deaf</button>
<button className="bg-teal-600 shadow-md border-2 border-teal-700 shadow-slate-400 mr-1 h-20 font-serif rounded-xl p-1 w-36" id="disabled" onClick={updateDisabled}>Disabled</button>

        </div>

        <div className="mt-1 flex justify-center">
        <button className=" bg-teal-600 border-2 border-slate-400 -700 shadow-md shadow-slate-400 font-serif mr-1 h-20 rounded-xl p-1 w-36" id="military" onClick={updateMilitary}>Military</button>
            <button className=" bg-teal-600 border-2 border-teal-700 shadow-md shadow-slate-400 h-20 font-serif rounded-xl p-1 w-36" id="childSurvivor" onClick={updateChildSurvivor}>Child Survivor</button>
        <button className=" bg-teal-600 shadow-md border-2 border-teal-700  shadow-slate-400 mr-1 h-20 font-serif rounded-xl p-1 w-36" id="elderSurvivor" onClick={updateElderSurvivor}>Elder Survivor</button>

        </div>
        <div className="mt-1 flex justify-center">
        <button className="bg-teal-600 shadow-md border-2 border-teal-700 shadow-slate-400 mr-1 h-20 font-serif rounded-xl p-1 w-36" id="specialNeeds" onClick={updateSpecialNeeds}>Special Needs</button>

        <button className="bg-teal-600 shadow-md border-2 border-teal-700 shadow-slate-400 mr-1 h-20 font-serif rounded-xl p-1 w-36" id="immigrants" onClick={()=>updateImmigrants}>Immigrants</button>

<button className=" bg-teal-600 shadow-md border-2 border-teal-700 shadow-slate-400 mr-1 font-serif   rounded-xl p-1  w-36" id="domesticViolence" onClick={updateDomesticViolence}>Domestic Violence</button>
        </div>
        <div className="flex justify-center mt-1 ">
        <button className=" bg-teal-600 border-2 border-teal-700 shadow-md shadow-slate-400 font-serif rounded-xl p-1 h-20 w-36" id="humanTrafficking" onClick={updateHumanTrafficking}>Human Trafficking</button>
        <button className=" bg-teal-600 shadow-md border-2 border-teal-700 shadow-slate-400 mr-1 h-20 font-serif rounded-xl p-1 w-36" id="allResources" onClick={updateAllResources}>All Resources</button>
        <button className=" bg-teal-600 border-2 border-slate-400 shadow-md shadow-slate-400 font-serif mr-1 rounded-xl p-1  h-20 w-36" id="crisisResources" onClick={updateCrisisResources}>Crisis Resources</button>
        </div>

        </div>
    )
}
export default Provider2
